import React from "react";

class NewUserForm extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <table>
          <tr>
            <input placeholder="Name" id="nameInput"></input>
          </tr>
          <tr>
            <input placeholder="Position" id="posInput"></input>
          </tr>
          <tr>
            <button onClick={() => UserService.postUser(document.getElementById("nameInput").textContent, document.getElementById("posInput").textContent)}>
              Add worker
            </button>
          </tr>
        </table>
      </div>
    )
  }
}


export default NewUserForm;
